import React, { Component } from 'react';
import { RegiWrapper } from 'components/Regibooks';



class Regibook extends Component {

      render() {
        return (
                <RegiWrapper>
                    <Route path="/main" component={Main} />
                </RegiWrapper>
        );
    }
}
export default Regibook;
